#include <iostream>
using namespace std;
/**
 * Definition for singly-linked list.
 * struct ListNode {
 *     int val;
 *     ListNode *next;
 *     ListNode(int x) : val(x), next(NULL) {}
 * };
 */

struct ListNode {
    int val;
    ListNode *next;
    ListNode(int x) : val(x), next(NULL) {}
};

class Solution {
public:
    ListNode *sortList(ListNode *head) {
        if(head == NULL || head->next == NULL) {
            return head;
        }        
        int count=0;
        ListNode *now=head;
        while(now != NULL){
            now=now->next;
            count++;
        }
        return recursiveMergeSort(head, count);
    }

    ListNode *mergeTwoLists(ListNode *l1, ListNode *l2){
        if(l1 == NULL){
            return l2;
        }else if(l2 == NULL){
            return l1;
        }
        ListNode *h=NULL, *ptr=NULL, *h1=l1, *h2=l2;
        while(1){
            if(h1->val <= h2->val){
                if(h != NULL){
                    ptr->next=h1;
                }else{
                    h=h1;
                }
                ptr=h1;
                h1=h1->next;
                if(h1 == NULL){
                    ptr->next=h2;
                    return h;
                }
            }else{
                if(h != NULL){
                    ptr->next=h2;
                }else{
                    h=h2;
                }
                ptr=h2;
                h2=h2->next;
                if(h2 == NULL){
                    ptr->next=h1;
                    return h;
                }
            }
        }
    }

    ListNode *recursiveMergeSort(ListNode *ptr, int length){
        if(length == 1){
            return ptr;
        }
        ListNode *iter_elem=NULL;
        for(int i=0; i<length/2; i++){
            if(iter_elem != NULL){
                iter_elem=iter_elem->next;
            }else{
                iter_elem=ptr;
            }
        }
        ListNode *l2=iter_elem->next;
        iter_elem->next=NULL;
        return mergeTwoLists(recursiveMergeSort(ptr, length/2), recursiveMergeSort(l2, length-length/2));
    }

};

